import React, { Component } from 'react';

class Search extends Component {

    constructor() {
        super();

        this.onSearch = this.onSearch.bind(this);
    }

    onSearch(event) {
        console.log(event);
    }

    render() {
        return (
            <div><input type="text" onChange={this.onSearch} /></div>
        );
    }
}

export default Search;
